import scala.io.Source
import scala.util.parsing.json._



def getDataItems(project: String, projIndex : Int): List[Tuple8[String, String, String, Boolean, Boolean, Boolean, Boolean, Boolean]] = {

    val topics = Array("BKRT", "CHAIR1", "MEET1", "CFO1", "CEO1", "DDEAL")

    var docsForProject: List[Tuple8[String, String, String, Boolean, Boolean, Boolean, Boolean, Boolean]] = List[Tuple8[String, String, String, Boolean, Boolean, Boolean, Boolean, Boolean]]()

    topics.foreach(topic => {

        val html = Source.fromURL("http://whyaron:9000/api/searchQuestionableDocs/fnr/"+project+"?filter=label:"+topic+"&fromIndex=0&pageSize=50&sortField=uncertaintyScore&sortOrder=desc")
        val s = html.mkString

        val json = JSON.parseFull(s)

        val map: Map[String,Any] = json.get.asInstanceOf[Map[String, Any]]

        val docs: List[Any] = map.get("docs").get.asInstanceOf[List[Any]]

        val docsMap: List[Tuple8[String, String, String, Boolean, Boolean, Boolean, Boolean, Boolean]] = docs.map( docMap => {
            val doc: Map[String,Any] = docMap.asInstanceOf[Map[String,Any]]
            val id: String = doc.get("id").get.asInstanceOf[String]
            val label: String = doc.get("label").get.asInstanceOf[String]
            val source: String = doc.get("source").get.asInstanceOf[String].replaceAll(",", ".")
            val score: Double = doc.get("score").get.asInstanceOf[Double]

            projIndex match {
                case 1 => (id, label, source, true, true, false, false, false)
                case 2 => (id, label, source, true, false, true, false, false)
                case 3 => (id, label, source, true, false, false, true, false)
                case 4 => (id, label, source, true, false, false, false, true)
            }

        })

        docsForProject = docsForProject ::: docsMap

    })



    docsForProject

}


def mergeMaps(list1 : List[Tuple8[String, String, String, Boolean, Boolean, Boolean, Boolean, Boolean]], list2 : List[Tuple8[String, String, String, Boolean, Boolean, Boolean, Boolean, Boolean]], index: Int) : List[Tuple8[String, String, String, Boolean, Boolean, Boolean, Boolean, Boolean]] = {

    var results: List[Tuple8[String, String, String, Boolean, Boolean, Boolean, Boolean, Boolean]] = List[Tuple8[String, String, String, Boolean, Boolean, Boolean, Boolean, Boolean]]()

    var list2Clone = list2

    list1.foreach(item1 => {

        var found = false
        var i: Int = 0

        list2.foreach(item2 => {

            // if id and label are equal
            if(item2._1 == item1._1 && item2._2 == item1._2) {
                found = true
                list2Clone = list2Clone.filterNot(elm => elm == item2)
                val row = index match {
                    case 2 => (item1._1, item1._2, item1._3, item1._4, item1._5, true, item1._7, item1._8)
                    case 3 => (item1._1, item1._2, item1._3, item1._4, item1._5, item1._6, true, item1._8)
                    case 4 => (item1._1, item1._2, item1._3, item1._4, item1._5, item1._6,  item1._7, true)
                }

                results = row :: results
            }

            i = i + 1

        })

        if(!found) {
            results = item1 :: results
        }
    })


    results ::: list2Clone

}

val map1 = getDataItems("6_topics_nd_1", 1)
val map2 = getDataItems("6_topics_nd_2", 2)
val map3 = getDataItems("6_topics_nd_3", 3)
val map4 = getDataItems("6_topics_nd_4", 4)

val m1 = mergeMaps(map1, map2, 2)

val m2 = mergeMaps(m1, map3, 3)

val m3 = mergeMaps(m2, map4, 4)

var csvString: String = "DocumentId,Label,isPositive,Source,isFeedback,project1,project2,project3,project4\n"


m3.foreach(item => {
    csvString = csvString + item._1 + "," + item._2 + ",," + item._3 + "," + item._4 + "," + item._5 + "," + item._6 + "," + item._7 + "," + item._8 + "\n"
})

println(csvString)
